import React from "react";
import Base from "../../components/base/base.component";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button } from "bootstrap";
class Home extends React.Component{
    constructor(){
        super();
    }
    render(){
        return(
           <Base>
           <Button>Add</Button>
                 <table className="table">
                    <thead>
                        <tr>
                        <th scope="col">#</th>
                        <th scope="col">First</th>
                        <th scope="col">Last</th>
                        <th scope="col">Handle</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                        <th scope="row">1</th>
                        <td>Mark</td>
                        <td>Otto</td>
                        <td>@mdo</td>
                        </tr>
                        <tr>
                        <th scope="row">2</th>
                        <td>Jacob</td>
                        <td>Thornton</td>
                        <td>@fat</td>
                        </tr>
                        <tr>
                        <th scope="row">3</th>
                        <td>Larry</td>
                        <td>the Bird</td>
                        <td>@twitter</td>
                        </tr>
                    </tbody>
                 </table>
           </Base>
        );
    }
}

export default Home;
